package com.hackerrank.programs;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.stream.Collectors;

public class JackAndDaniels {

	public static void main(String[] args) {
		String a = "";
		String b = "";
		String out = "";

		ArrayList<String> a1 = new ArrayList<>(Arrays.asList(a.split("")));
		ArrayList<String> b1 = new ArrayList<>(Arrays.asList(b.split("")));

		while (a1.size() > 0 && b1.size() > 0) {
			if (a1.get(0).charAt(0) < b1.get(0).charAt(0)) {
				out = out + a1.get(0);
				a1.remove(0);
			} else if (a1.get(0).charAt(0) > b1.get(0).charAt(0)) {
				out = out + b1.get(0);
				b1.remove(0);
			} else if (a1.get(0).charAt(0) == b1.get(0).charAt(0)) {
				out = out + a1.get(0);
				a1.remove(0);

			}
		}
		if (a1.isEmpty() && b1.isEmpty()) {
			System.out.println(out);
		} else if (a1.isEmpty()) {
			for (String string : b1) {
				out = out + string;
			}
			System.out.println(out);
		} else if (b1.isEmpty()) {
			for (String string : a1) {
				out = out + string;
			}
			System.out.println(out);
		}
		// System.err.println(out.length());
		String ss = "";
		// System.err.println("".length());
		for (int i = 0; i < out.length(); i++) {
			if (!(out.charAt(i) == ss.charAt(i))) {
				System.err.print(out.charAt(i) + " ");
				System.err.println(ss.charAt(i));
				System.err.print(i);
			}
		}
	}

}
